import React from 'react';
import { View, Image, StyleSheet } from 'react-native';
const HomeIcons = () => {
    return (
        <View style={styles.h_icons}>
            <View style={styles.h_flex}>
                <View style={styles.h_Imgs}>
                    <Image source={require("../../assets/h_1.jpg")} style={styles.h_img} />
                </View>
                <Image source={require("../../assets/h_2.jpg")} style={styles.h__img} />
                <Image source={require("../../assets/h_3.jpg")} style={styles.h__img} />
                <Image source={require("../../assets/h_4.png")} style={styles.h__img} />
                <Image source={require("../../assets/h_5.jpg")} style={styles.h__img} />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    h_icons: {
        width: '100vw',
        backgroundColor: "#fff",
        boxShadow: ' rgba(0, 0, 0, 0.05) 0px 6px 24px 0px, rgba(0, 0, 0, 0.08) 0px 0px 0px 1px',
    },
    h_flex: {
        width: '95vw',
        padding: '10px',
        margin: 'auto',
        backgroundColor: "#ff",
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    h_Imgs: {
        width:'35px',
        height:'35px',
        padding: '10px',
        borderRadius: '50%',
        backgroundColor: "#FDEFD9",
        alignItems:'center',
        textAlign:'center',
        
    },
    h_img: {
        width: '28px',
        height: '28px',
        color: "orange",
        borderRadius: '50%',
    }

})

export default HomeIcons;
